Text:
@anathelastjedi @Talafatejang خارج از کدوم کشور؟
استاد اقتصاد مارو بخاطر انتقاد (زبانی) از طولانی شدن قرنطینه کرونا اخراج کردن🤷‍♂️
سیستم آلوده همه جای دنیا هست

@Hashshaashin حتی الان هم که گندِ واکسن ها در اومده اینها دارن سینه خیز میرن

یه احمقایی بودن تا همین امسال هم می گفتن «اگر قم قرنطینه شده بود کرونا نمی اومد»
شما از همون جنس «احمق های درجه یک» هستید

@ehsanmansuri @h0d3r_fa بی ناموس فراموش نکردیم که با یک علامت دست ورود واکسن امریکایی و انگلیسی به کشور ممنوع شد.
احساس میکنم تو کتاب ۱۹۸۴ جرج اورول هستیم و یک عده تمام تلاشش شون رو میکنن تاریخ و گذشته رو وارونه نشان بدهند و حتی پاک کنند،گویی کارشان اینست و بابتش دستمزد می‌گیرند.
پیشوای بزرگ دوباره رید،

@SaraAryan79 @ehsanmansuri اشتباه فهمیدی!
سید علی گفت واکسن آمریکایی ممنوع، خیلی هم طول نکشید که گند واکسن های آمریکایی در آمد!
از طرفی هم اگر ممنوع هم نشده بود معلوم نبود چقدر به ما می‌دادند و اگر هم می‌خواستند بدهند، مگر چند دوز می‌توانستند بدهند!

@Sarbaz_Rahbar14 @sobhan_70 اصن بگو یک میلیون کنتر که نمیندازه 😂
دو ماه بعد از اینکه رهخر حرومزادتون واکسن رو ممنوع کرد مادربزرگ من از کرونا فوت کرد چون شما پدرسگا واکسن وارد نکرده بودید از جایی هنوز البته شک دارم حتی ذره ای واستون مهم باشه
الان بری درمانگاها از کسی تست کرونا نمیگیرن میگن آنفولانزاست

@blueberryy2023 @Khamenei_fa چندین ماه وقت تلف کردید به بهانه ساخت داخل نگذاشتید واکسن وارد مملکت شود. واکسن های انگلیسی  و آمریکایی را کلا ممنوع کردید و بسیاری از هموطنانمان را به کشتن دادید.
وقتی کرونا شروع شد پروازهای به چین را قطع نکردید.
خدا از شما نگذره.
